const ClubsPage = () => {
  const dispatch = useDispatch();

  useEffect(async() => {
    await dispatch(getClubs())
  }, [dispatch])

  const clubs = useSelector(state => Object.values(state.clubs))

  return (
    <div className = {styles.clubCardContainer} >
      <div>
        abcd
      </div>
      <div>
        npak
      </div>
      {clubs.map((club) => (
        <ClubsCard className = {styles.clubCard} club={club}/>
      ))}
    </div>
  )
}

export default ClubsPage;
